import React from "react";

class BurgerCart extends React.Component {
    constructor(props) {
        super(props)
    }
    render () {

        return (
            <>
                {this.props.ingredients.map((arr) => {
                    return (
                        <>
                        <p>{arr.name}</p>
                        <img src={arr.name}></img>
                    </>
                    )
                })}
            </>
        )
    }
}

export default BurgerCart
